`

export const TextContainer = styled.span`
    padding-right: 2em;
    display: flex;
    justify-content: center;
    width: 100%; 
`

export const CardContainer = styled.span`
    padding: 1em;
    display: flex;
    justify-content: center;
    width: 50%; 
`

